package pawanroy.leetcode.`389-find-the-difference`

import kotlin.test.Test
import kotlin.test.assertEquals

class SolutionTest {
    @Test
    fun caseOne(){
        val expected = 'e'
        assertEquals(expected, Solution().findTheDifference("abcd", "abcde"))
    }

    @Test
    fun caseTwo(){
        val expected = 'y'
        assertEquals(expected, Solution().findTheDifference("", "y"))
    }

    @Test
    fun large(){
        val s = ""
        val t = ""
        val expected = 't'
        assertEquals(expected, Solution().findTheDifference(s,t))
    }
}